The feelings of Mental Wellness knows no age boundaries. No one should feel alone.

THIS Sunday, January 29th 12pm-3pm (Crescent side of City Hall) we will be having a special Mayor’s Mental Wellness event - partnering with our amazing Teen Advisory Committee. At 1pm, we’ll be welcoming the co-founders of the Madhappy lifestyle brand and podcast for a panel discussion about mental health. There will also be Arts and Culture workshops available and booths with local mental health resources. Let’s continue shining a light on  mental health.
