TODAY we have a special Mayor’s Mental Wellness Series from 12pm-3pm OUTSIDE on the Crescent side (if raining we will be inside)  of City Hall. My special guests are the incredible co-founders of the Madhappy brand and podcast. At 1pm we will be having a panel discussion with them about mental health. Grateful to our beloved Teen Advisory Committee for partnering with today’s event that will also include arts and culture workshops and valuable Mental Wellness resource booths. Cannot wait to come together again to learn about how we can help each other and ourselves. 💗 #MayorsMentalWellnessSeries 
