So many are carrying so much that we know nothing about. Today, August 31st is International Overdose Day. With all my heart, I send all my love to the families and dear friends who have lost someone they love. Our city hall again will be lit 💜 so we will never forget those that have gone before us and we will stand alongside those who are grieving a loss. We must always give love and remember to check in on one another no matter what. 
@overdoseawarenessday
